                id INTEGER PRIMARY KEY AUTOINCREMENT,
                timestamp TIMESTAMP NOT NULL,
                exchange TEXT NOT NULL,
                strike REAL NOT NULL,
                option_type TEXT NOT NULL,
                symbol TEXT NOT NULL,
                oi INTEGER,
