                exchange TEXT PRIMARY KEY,
                last_update_time TIMESTAMP NOT NULL,
                last_atm_strike REAL,
                last_underlying_price REAL,
                updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
